import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  registerInfo = {
    username : '',
    email: '',
    password : ''
  }
}
<h1>Sign In Form</h1>

<form>
  <label>Username</label>
  <input type="text" [(ngModel)]="registerInfo.username">
  <span>*</span>
  <br>

  <label>E-mail</label>
  <input type="email" [(ngModel)]="registerInfo.email">
  <br>

  <label>Password</label>
  <input type="password" [(ngModel)]="registerInfo.password">
  <br>

</form>
